Delivery charges: &lt;br/&gt;
option 1: 16$ per collection (day shift 8:00-16:00) &lt;br/&gt;
               10$ per collection (night shift 19:00-2:00)&lt;br/&gt;
option 2: Your organization can deliver recyclables to our collection &lt;br/&gt;
              points in Jisr El wati and Jisr el Bacha free of charge. &lt;br/&gt;
              For big quantities you can deliver the recyclables to one
              of our sorting stations in Baabda or Taanayel. &lt;br/&gt;
              Rules of delivery: &lt;br/&gt;
              1. Schedule of delivery in Baabda, jisr el wati and jisr el bacha:
              M-F from 8:00 – 16:00 &lt;br/&gt;
              2. Schedule of delivery in Taanayel: M-F from 8:30 – 17:30 &lt;br/&gt;
              3. Schedule of delivery in Damour: M-F from 8:00 – 16:30 &lt;br/&gt;
              4. Our stations have no solutions for non-recyclable/organic
               waste, if found in big quantities our sorting station might
               reject them. &lt;br/&gt;

Contra International sarl will provide the organization with 10 cardboard bins free of charge, any additional needed cardboard bin will be purchased as following: &lt;br/&gt;
Single cardboard (paper, plastic, or aluminum): 3$ &lt;br/&gt;
Cardboard trio: 5$ &lt;br/&gt;
*if damaged, 10 bins can be exchanged for free once per year only &lt;br/&gt;
120L plastic trolley: 51$ &lt;br/&gt;
240L plastic trolley: 73$ &lt;br/&gt;
360L plastic trolley: 98$ &lt;br/&gt;
1100L plastic trolley: 450$ &lt;br/&gt;
